import '../styles/App.css';
import Navbar from './Navbar';
import Contacts from './Contacts';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom/cjs/react-router-dom.min';


function App() {
  return (
    <div className="App">
      <div className="container">
        <Router>
        <Navbar />
        <Contacts/>
        </Router>
      </div>
    </div>
  );
}

export default App;
